;; **
;;; Distance between two dots
;; **

;; @@
(defn distance [vec1 vec2]
  (-> (minus vec1 vec2)
      (#(pow % 2))
      (sum)
      (sqrt)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/distance</span>","value":"#'talented-abyss/distance"}
;; <=

;; @@
(defn data->distances [matrix-data]
  (matrix (map (fn [v1] (map #(distance v1 %) matrix-data)) matrix-data)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/data-&gt;distances</span>","value":"#'talented-abyss/data->distances"}
;; <=

;; @@
(def distances (data->distances matrix-data))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/distances</span>","value":"#'talented-abyss/distances"}
;; <=

;; @@
(defn distances->proximities [distances]
  (let [N (count distances)
        eta (/ (reduce + (map #(pow % 2) (flatten distances))) (* 2 (pow N 2)))
        dist2origin (fn [vec] (- (/ (sum (pow vec 2)) N) eta))
        d2o (map dist2origin distances)
        d->p (fn [id1 id2 d1 d2]
               (- (+ d1 d2)
                  (/ (pow (sel distances id1 id2) 2) 2)))]
    (matrix
      (map-indexed
        (fn [id1 d1] map-indexed (fn [id2 d2] (d->p id1 id2 d1 d2)) d2o)
        d2o))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/distances-&gt;proximities</span>","value":"#'talented-abyss/distances->proximities"}
;; <=

;; @@
(def proximities (distances->proximities distances))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/proximities</span>","value":"#'talented-abyss/proximities"}
;; <=

;; @@
(defn last? [num clustering]
  (= 1 (count (filter #{num} clustering))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/last?</span>","value":"#'talented-abyss/last?"}
;; <=

;; @@
(defn eta [mat]
  (let [n (count mat)
        squared (map #(pow % 2) (flatten mat))
        num (reduce + squared)
        den (* 2 (pow n 2))]
  (/ num den)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/eta</span>","value":"#'talented-abyss/eta"}
;; <=

;; **
;;; Average weighted dispersion of clusters.
;;; 
;;; $$ J(K) = 1 / N * (sum_{k = 1}^{K} N_k * \eta_k^2) $$
;; **

;; @@
(defn cluster-numbers [num clustering]
  (map first (filter #(= (second %) num) (map-indexed vector clustering))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/cluster-numbers</span>","value":"#'talented-abyss/cluster-numbers"}
;; <=

;; @@
(defn cluster [num clustering data]
  (let [nums (cluster-numbers num clustering)]
  (sel data :rows nums :cols nums)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/cluster</span>","value":"#'talented-abyss/cluster"}
;; <=

;; @@
(defn intercluster [num1 num2 clustering data]
  (let [nums1 (cluster-numbers num1 clustering)
        nums2 (cluster-numbers num2 clustering)]
    (sel data :rows nums1 :cols nums2)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/intercluster</span>","value":"#'talented-abyss/intercluster"}
;; <=

;; @@
(defn weighted-dispersion [num clustering data]
  (let [c (cluster num clustering data)]
    (* (eta c) (count c))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/weighted-dispersion</span>","value":"#'talented-abyss/weighted-dispersion"}
;; <=

;; @@
(defn calculate-dispersion [clustering data]
  (let [weighted (map #(weighted-dispersion % clustering data) (distinct clustering))]
  ( / (reduce + weighted)
      (count clustering))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/calculate-dispersion</span>","value":"#'talented-abyss/calculate-dispersion"}
;; <=

;; @@
(defn proximity [num1 num2 clustering data]
  (let [div (reduce + (flatten (intercluster num1 num2 clustering data)))
        den (* (count (cluster-numbers num1 clustering))
               (count (cluster-numbers num2 clustering)))]
    (/ div den)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/proximity</span>","value":"#'talented-abyss/proximity"}
;; <=

;; @@
(defn calculate-proximity [clustering data]
  (let [ids (distinct clustering)
        den (pow (count ids) 2)]
    (/ (reduce 
         (fn [a id1]
           (+ a (reduce (fn [a' id2]
                          (+ a' (proximity id1 id2 clustering data))) ids)))
        ids) den)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/calculate-proximity</span>","value":"#'talented-abyss/calculate-proximity"}
;; <=

;; @@
(defn quality [weight clustering distances proximities]
  (let [comp1 (calculate-proximity clustering proximities)
        comp2 (calculate-dispersion clustering distances)]
    (-(* weight comp1)
      (* (- 1 weight) comp2))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/quality</span>","value":"#'talented-abyss/quality"}
;; <=

;; @@
(defn draw-clustering [clustering data]
  (let [x (sel data :cols 0)
        y (sel data :cols 1)
        sp (scatter-plot x y
                         :group-by clustering)]
  (chart-view sp)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/draw-clustering</span>","value":"#'talented-abyss/draw-clustering"}
;; <=

;; @@
(defn try-move! [id clustering weight distances proximities]
  (let [qual (fn [cluster-number]
               (quality weight
                        (assoc @clustering cluster-number id)
                        distances
                        proximities))]
    (if-not (last? (@clustering id) @clustering)
      (swap!
        clustering
        assoc id (apply min-key qual (distinct @clustering))))
    id))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/try-move!</span>","value":"#'talented-abyss/try-move!"}
;; <=

;; @@
(defn clusterize-iteration! [clustering weight distances proximities]
  (map #(try-move! % clustering weight distances proximities) (range (count @clustering))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;talented-abyss/clusterize-iteration!</span>","value":"#'talented-abyss/clusterize-iteration!"}
;; <=

